cy.request({
  method: 'GET',
  url: url,
  followRedirect: false,
  headers: {
    'accept': 'application/json'
  }
}).then(response => {
  // Parse JSON the body.
  let newData = response.body.products;
  for (let pdp of newData) {
    if (pdp.tags.includes('#Sale')) {
      skus.push(pdp.id);
      pdpName.push('/products/' + pdp.handle);
    }
  }
});
